import { SearchBar, SearchIcon } from 'material-ui-search-bar'
export default function SearchBox() {
    return(
        <div className='h-12 w-1/4 border border-black m-5 text-right'>
            <SearchBar
                onChange={ () => console.log('debounce this')}
                onRequestSearch={ () => console.log('onRequestSearch')}
                className='my-0 mx-auto max-w-4xl' >
                <SearchIcon className='text-left'/>
            </SearchBar>

        </div>
    )
}
